function IngredientNameQuant() {
  const ingredientQuantity = '1 tsp'
  const ingredientName = 'Sugar'

  return (
    <div>
      <div class="ingredient-quantity">{ingredientQuantity}</div>
      <div class="ingredient-name">{ingredientName}</div>
    </div>
  )
}

export default IngredientNameQuant
